sys_variable_value.value:
(function execute(inputs, outputs) {
  var packagesReportArray = []
  while(inputs.packagesList.next()){
    // instantiate script include using acquistion package
    // push object returned from script include to array declared outside while loop
    // convert array of json objects to CSV
    // create file name "DAPPS Report MM-DD-YY.csv"
    // write to that file
    var reportGen = new DappsReportGen(inputs.packagesList);
    var packageReport = reportGen.getReportRecord();
    // build case for if package Report is empty
    packagesReportArray.push(packageReport);


  }

  // Logic for getting date in correct format for file name
  var csvUtils = new CSVUtils();
  var csvText = csvUtils.convertToCSV(packagesReportArray);
  var gdt = new GlideDateTime();
  var currentDate = gdt.getDate()

  var dateArray = currentDate.toString().split("-");

  var currentYear = dateArray[0].slice(-2);
  var currentMonth = dateArray[1];
  var currentDay = dateArray[2];

  var fileName = `DAPPS Report ${currentMonth}-${currentDay}-${currentYear}.csv`;


  //getting and using the utils to convert to CSV and write to file
  var csvUtils = new CSVUtils();
  var csvText = csvUtils.convertToCSV(packagesReportArray);

  outputs.attachment_sysid = csvUtils.writeCSVToDocument(csvText, fileName);


})(inputs, outputs);

